class VectorIndex:
    def __init__(self, dim: int):
        self.index = faiss.IndexFlatIP(dim)  # Inner Product (use with normalized vectors for cosine sim)
        self.chunk_metadata: List[Dict[str, str]] = []

    def add(self, vectors: np.ndarray, chunk_dicts: List[Dict[str, str]]):
        if len(vectors) != len(chunk_dicts):
            raise ValueError("Mismatch between number of vectors and metadata.")

        faiss.normalize_L2(vectors)
        self.index.add(vectors)
        self.chunk_metadata.extend(chunk_dicts)


    def search(self, query_vector: np.ndarray, top_k: int = 5) -> List[Tuple[int, float, Dict[str, str]]]:
        faiss.normalize_L2(query_vector)
        scores, indices = self.index.search(query_vector, top_k)

        results = []
        for i, score in zip(indices[0], scores[0]):
            if i == -1:
                continue
            results.append((i, score, self.chunk_metadata[i]))
        return results

class SemanticSearchEngine:
    def __init__(self, embedder: Embedder, index: VectorIndex):
        self.embedder = embedder
        self.index = index

    def search(self, query: str, top_k: int = 5) -> List[Tuple[int, float, str]]:
        """
        Embeds the query and searches the index.

        Returns:
            List of (index, score, chunk_text)
        """
        query_vec = self.embedder.embed([query]).astype("float32")
        return self.index.search(query_vec, top_k=top_k)

def parse_docx(file_path: str) -> dict:
    """
    Parses a .docx file and returns its content and metadata.

    Returns:
        {
            "filename": ...,
            "content": ...,
            "word_count": ...
        }
    """
    path = Path(file_path)

    if not path.exists():
        raise FileNotFoundError(f"File not found: {file_path}")

    if path.suffix.lower() != ".docx":
        raise ValueError("Only .docx files are supported by docx_parser.")

    document = Document(file_path)
    paragraphs = [p.text.strip() for p in document.paragraphs if p.text.strip()]
    content = "\n".join(paragraphs)

    return {
        "filename": path.name,
        "content": content,
        "word_count": len(content.split())
    }

