        return parse_pdf(filepath)
    elif ext == ".md":
        return parse_md(filepath)
    elif ext == ".csv":
        return parse_csv(filepath)
    else:
        raise ValueError(f"Unsupported file extension: {ext}")

def load_and_chunk_files(filepaths: List[str]) -> List[Dict]:
    """
    Parse each file and return a flat list of chunk dicts.
    Each dict contains { "filename", "content" }
    """
    all_chunks = []

    for filepath in filepaths:
        parsed = parse_file(filepath)
        chunks = chunk_text(parsed["content"])
        for chunk in chunks:
            all_chunks.append({
                "filename": parsed["filename"],
                "content": chunk
            })

    return all_chunks

def parse_md(file_path: str) -> dict:
    """
    Parses a markdown (.md) file and returns content and metadata.

    Returns:
        {
